import React from "react";

const DropDown = () => {
  const [open, setOpen] = React.useState(false);

  const handleOpen = () => {
    setOpen(!open);
  };

  return (
    <div className="dropdown">
      <button onClick={handleOpen} className="menuButton"></button>
      {open ? (
        <ul className="menu">
          <li>
            <button><a></a>Профиль</button>
          </li>
          <li>
            <button>Список желаний</button>
          </li>
          <li>
            <button>Добавить желание</button>
          </li>
          <li>
            <button>Выйти</button>
          </li>
        </ul>
      ) : null}
    </div>
  );
};

export default DropDown;
